import { useEffect } from "react";
import React, { useState } from 'react';
import { useNavigate } from "react-router-dom";
import axios from "axios";
import Exercise from '../pagecreation/Exercise';
import './CreateWorkout.css';

function CreateWorkout(props) {
    const navigate = useNavigate();

    const [title, setTitle] = useState('My Workout');
    const [showExercise, setShowExercise] = useState(false);

    const changeTitle = () => {
        const newTitle = prompt('Enter new title:', title);
        if (newTitle) setTitle(newTitle);
    };

    return (
        <div className="display-container">
            <h1 onClick={changeTitle}>{title}</h1>
            {showExercise ? <Exercise /> : null}
            <button onClick={() => setShowExercise(true)}>New Exercise</button>
            {showExercise ? <button onClick={() => setShowExercise(false)}>Hide Exercise</button> : null}
        </div>
    )
};

export default CreateWorkout;
